import './App.css';
import Axios from 'axios';
import { useState } from 'react';

function App() {
  const [ locationList, setLocationList ] = useState([]);
  const getLocation = () => {
    Axios.get('http://localhost:3001/location').then((response) => {
      setLocationList(response.data);
    });
  }
  const userLocation = locationList.map((val,key) => {
    return(
      <div className="location-card">
        <div className="card-body test-left">
          <p className="card-text">Lat: {val.Latitude}</p>
          <p className="card-text">Lng: {val.Longtitude}</p>
          <button className="button-show-location">Show location</button>
        </div>
      </div>
    );
  })  
  return (
    <div className="container">
      <button className="button-load-location" onClick={getLocation}>location</button>
      {userLocation}
    </div>
  );
}

export default App;
